// ==UserScript==
// @name           Pandora Radio General Beautification
// @namespace      Pandora Radio
// @description    Centers, removes ads, and gives a nice look to Pandora Radio
// @stolenFrom     http://userscripts.org/scripts/show/5538
// @stolenFrom     http://userscripts.org/scripts/show/25420
// @include        http://pandora.com/*
// @include        http://*.pandora.com/*
// ==/UserScript==

var tuner = document.getElementById('tuner').innerHTML;
var newBody = '<div style="margin:0 auto; padding-top:53px; width:565px;">' + tuner + '</div>';

window.addEventListener(
    'load', 
    function() {
      /* Replace */
      document.body.innerHTML = newBody;
      
      /* Just in case */
      document.body.style.paddingTop = '0';
      
      /* Ooh, how about a nice background? */
      document.body.style.background = "url('data:image/png;base64,') top center no-repeat";
    },
    true);